// import Nav from "./Nav"
import { Nav, Navbar, NavbarBrand } from "react-bootstrap"

const Header = () => { 
    return (
        <Navbar
            className="my-2"
            color="dark"
            dark
        >
            <NavbarBrand href="/">
            <img
                alt="logo"
                src="./logo192.png"
                style={{
                height: 40,
                width: 40
                }}
            />            
            Nav Bar de ecommerce
                <Nav
                    type="header"
                />
            </NavbarBrand>
        </Navbar>   
    )
}

export default Header

